import React from 'react'
// import './leftContainer.scss';
import './App.scss';
import { withRouter } from "react-router";
import Navbar from './Navbar';

class RightContainer extends React.Component {
    render() {
	    <div className={ "rightContainer " }>
			<Switch>
				<Route exact path="/works" component={ Works } changeLeftContainer={ this.changeLeftContainer.bind(this) } />
				<Route exact path="/works/one" component={ StudyOne } />
				<Route exact path="/works/two" component={ StudyTwo } />
				<Route exact path="/about" component={ About } />
				<Route exact path="/" component={ Home } />
			</Switch>
			<Navbar />
	    </div>
    }
}

export default withRouter(RightContainer)
